import React, { useState } from 'react';
import { Box, Typography, TextField, Chip, LinearProgress } from '@mui/material';
import AddRoundedIcon from '@mui/icons-material/AddRounded';
import TaskItem from './TaskItem';

function TaskList({ listName, listColor, tasks, onToggle, onAdd, onDelete }) {
  const [newTask, setNewTask] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    if (newTask.trim()) {
      onAdd(newTask);
      setNewTask('');
    }
  };

  const completedCount = tasks.filter(t => t.completed).length;
  const totalCount = tasks.length;
  const progress = totalCount > 0 ? (completedCount / totalCount) * 100 : 0;

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', height: '100%' }}>
      {/* Header */}
      <Box sx={{ mb: 3 }}>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, mb: 1 }}>
          <Typography 
            variant="h4" 
            sx={{ 
              background: 'linear-gradient(135deg, #F3F4F6 0%, #9CA3AF 100%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              fontWeight: 700,
            }}
          >
            {listName} Tasks
          </Typography>
          <Chip 
            label={`${completedCount} / ${totalCount}`}
            size="small"
            sx={{ 
              bgcolor: 'rgba(139, 92, 246, 0.15)',
              color: 'primary.main',
              fontWeight: 700,
              fontSize: '0.85rem',
              border: '1px solid rgba(139, 92, 246, 0.3)',
            }}
          />
        </Box>

        {/* Progress bar */}
        {totalCount > 0 && (
          <Box sx={{ mb: 2 }}>
            <LinearProgress 
              variant="determinate" 
              value={progress}
              sx={{
                height: 6,
                borderRadius: 3,
                bgcolor: 'rgba(139, 92, 246, 0.1)',
                '& .MuiLinearProgress-bar': {
                  borderRadius: 3,
                  background: 'linear-gradient(90deg, #A78BFA, #06B6D4)',
                }
              }}
            />
            <Typography 
              variant="caption" 
              sx={{ color: 'text.secondary', mt: 0.5, display: 'block' }}
            >
              {Math.round(progress)}% Complete
            </Typography>
          </Box>
        )}

        <Typography 
          variant="body2" 
          sx={{ 
            color: 'text.secondary',
            fontWeight: 400,
          }}
        >
          Manage your {listName.toLowerCase()} schedule efficiently
        </Typography>
      </Box>

      {/* Add Task Input */}
      <form onSubmit={handleSubmit}>
        <TextField
          fullWidth
          placeholder={`Add new ${listName.toLowerCase()} task...`}
          value={newTask}
          onChange={(e) => setNewTask(e.target.value)}
          sx={{ 
            mb: 3,
            '& .MuiOutlinedInput-root': {
              bgcolor: 'rgba(139, 92, 246, 0.05)',
              borderRadius: 2,
              transition: 'all 0.3s',
              '& fieldset': {
                borderColor: 'rgba(139, 92, 246, 0.2)',
              },
              '&:hover fieldset': {
                borderColor: 'primary.main',
              },
              '&.Mui-focused fieldset': {
                borderColor: 'primary.main',
                borderWidth: '2px',
              },
              '&.Mui-focused': {
                bgcolor: 'rgba(139, 92, 246, 0.08)',
                boxShadow: '0 0 0 4px rgba(139, 92, 246, 0.1)',
              }
            }
          }}
          InputProps={{
            startAdornment: (
              <AddRoundedIcon 
                sx={{ 
                  mr: 1, 
                  color: 'primary.main',
                  fontSize: '1.3rem'
                }} 
              />
            ),
          }}
        />
      </form>

      {/* Task List with scroll */}
      <Box 
        sx={{ 
          flex: 1,
          overflowY: 'auto',
          pr: 1,
          '&::-webkit-scrollbar': {
            width: '6px',
          },
          '&::-webkit-scrollbar-track': {
            bgcolor: 'rgba(139, 92, 246, 0.05)',
            borderRadius: '10px',
          },
          '&::-webkit-scrollbar-thumb': {
            bgcolor: 'rgba(139, 92, 246, 0.3)',
            borderRadius: '10px',
            '&:hover': {
              bgcolor: 'rgba(139, 92, 246, 0.5)',
            }
          }
        }}
      >
        {tasks.length === 0 ? (
          <Box 
            sx={{ 
              textAlign: 'center', 
              py: 6,
              borderRadius: 2,
              border: '2px dashed rgba(139, 92, 246, 0.2)',
              bgcolor: 'rgba(139, 92, 246, 0.02)',
            }}
          >
            <Typography 
              sx={{ 
                color: 'text.secondary',
                fontSize: '0.95rem',
                mb: 1
              }}
            >
              No tasks yet
            </Typography>
            <Typography 
              variant="caption" 
              sx={{ color: 'text.secondary' }}
            >
              Add your first task above to get started
            </Typography>
          </Box>
        ) : (
          tasks.map(task => (
            <TaskItem
              key={task.id}
              task={task}
              onToggle={onToggle}
              onDelete={onDelete}
            />
          ))
        )}
      </Box>
    </Box>
  );
}

export default TaskList;
